INSERT INTO `cms` VALUES (1, 'Ucapan Selamat Datang', '<h4 class=\"vc_custom_heading\">Selamat datang di MNK Whistleblowing System</h4>\r\n\r\n<p>MNK Whistleblowing System adalah aplikasi yang disediakan oleh PT. Multi Nitrotama Kimia bagi pihak eksternal dan internal perusahaan, yang memiliki informasi dan ingin melaporkan suatu perbuatan berindikasi Fraud dan/atau pelanggaran yang terjadi di lingkungan perusahaan.</p>\r\n\r\n<p>Anda tidak perlu khawatir terungkapnya identitas diri anda karena PT. Multi Nitrotama Kimia akan merahasiakan identitas diri anda sebagai <em>whistleblower</em>. PT. Multi Nitrotama Kimia menghargai informasi yang Anda laporkan. Fokus kami kepada materi informasi yang Anda Laporkan.</p>', 'Beranda', 1, 'Sistem', 'Administrator', '2023-01-06 01:39:44', '2023-01-10 18:24:41', 1, 'textarea', 'img-beranda.jpg');
INSERT INTO `cms` VALUES (2, 'Kata Pengantar', '<h4 class=\"vc_custom_heading\">Penyampaian Pelaporan</h4>\r\n\r\n<p>Dalam rangka mempermudah dan mempercepat proses tindak lanjut, pengaduan&nbsp;fraud&nbsp;dan/atau pelanggaran yang dilaporkan, sebaiknya dapat memenuhi informasi yang jelas dan dapat dipertanggungjawabkan serta dilengkapi dengan bukti yang relevan, kompeten dan cukup, diantaranya meliputi:</p>\r\n\r\n<ul>\r\n	<li><strong>What:</strong> Perbuatan berindikasi pelanggaran yang diketahui</li>\r\n	<li><strong>Where:</strong> Dimana perbuatan tersebut dilakukan</li>\r\n	<li><strong>When:</strong> Kapan perbuatan tersebut dilakukan</li>\r\n	<li><strong>Who:</strong> Siapa saja yang terlibat dalam perbuatan tersebut</li>\r\n	<li><strong>How:</strong> Bagaimana perbuatan tersebut dilakukan (modus, cara, bukti, kerugian, dsb.)</li>\r\n</ul>\r\n\r\n<p>Selain, dengan dashboard pada web ini pelaporan juga dapat langsung dikirimkan melalui email <strong>pengaduan@mnk.co.id</strong> dan whatsapp melalui nomor <strong>+6281xxxxxxx</strong>.</p>', 'Beranda', 1, 'Sistem', 'Administrator', '2023-01-06 01:39:44', '2023-01-10 18:08:53', 1, 'textarea', 'img-beranda.jpg');
INSERT INTO `cms` VALUES (3, 'Tindak Lanjut', '<h4 class=\"vc_custom_heading\">Tindak Lanjut</h4>\r\n\r\n<p>Apabila Bapak/Ibu ingin mengetahui status, perkembangan dan tindak lanjut atas laporan yang telah dibuat, dapat menginput nomor laporan pengaduan pada menu di bawah ini:</p>', 'Beranda', 1, 'Sistem', 'Administrator', '2023-01-06 01:39:44', '2023-01-10 18:08:53', 1, 'textarea', 'img-beranda.jpg');
INSERT INTO `cms` VALUES (4, 'Kata Pengantar', '<h4 class=\"vc_custom_heading\">Form Pengaduan</h4>\r\n\r\n<p>Jangan khawatir! Kami akan menjamin kerahasiaan identitas diri anda sebagai whistleblower. Laporan dapat disampaikan dengan nama samaran/alias.</p>', 'Form Pengaduan', 1, 'Sistem', 'Administrator', '2023-01-06 01:39:44', '2023-01-10 18:08:00', 2, 'textarea', 'img-form-pengaduan.jpg');
INSERT INTO `cms` VALUES (5, 'Ucapan Terima Kasih', '<h4 class=\"vc_custom_heading\">Pengaduan Telah Diterima</h4>\r\n\r\n<p>Kami ucapkan terima kasih atas partisipasi bapak/ibu telah membuat laporan pengaduan di MNK Whistleblower system.</p>\r\n\r\n<h4 style=\"text-align:center;\"><font color=\"red\"><b>NOMOR PENGADUAN DAN TOKEN HANYA MUNCUL SATU KALI! CATATLAH/SIMPAN DENGAN BAIK. </b></font></h4>', 'Info Pengaduan', 1, 'Sistem', 'Administrator', '2023-01-06 01:39:44', '2023-01-19 15:02:16', 3, 'textarea', 'img-status-pengaduan.jpg');
INSERT INTO `cms` VALUES (6, 'Disclaimer', '<p>Bapak/Ibu dapat memantau progres tindak lanjut laporan pada menu sebelumnya dengan menginput nomor laporan tersebut. Isi laporan anda kami jamin kerahasiaannya dan akan kami tindak lanjuti sesuai peraturan dan ketentuan yang berlaku.</p>\r\n\r\n<p>PT. Multi Nitrotama Kimia memiliki komitmen untuk menjalankan perusahaan secara profesional dengan berlandaskan pada perilaku perusahaan yang sesuai dengan Budaya Kerja dan sikap kerja perusahaan, khususnya nilai budaya Integritas.</p>', 'Info Pengaduan', 1, 'Sistem', 'Administrator', '2023-01-06 01:39:44', '2023-01-19 15:00:26', 3, 'textarea', 'img-status-pengaduan.jpg');
