INSERT INTO `cms` VALUES (11, 'Isi', '<p>Laporan Bapak/Ibu telah kami terima dan akan kami tindak lanjuti.</p>', 'Status Pengaduan', 1, 'Sistem', 'Sistem', '2023-01-06 12:17:01', '2023-01-06 12:40:48', 7, 'textarea', 'img-status-pengaduan.jpg');
INSERT INTO `cms` VALUES (12, 'Keterangan', '<p>Bapak ibu juga dapat melampirkan bukti atau keterangan tambahan untuk laporan ini.</p>', 'Status Pengaduan', 1, 'Sistem', 'Sistem', '2023-01-06 12:17:01', '2023-01-06 12:40:48', 7, 'textarea', 'img-status-pengaduan.jpg');
